import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import WordChoose from "../WordChoose/WordChoose";

const Welcome = (props) => {
  const navigator = useNavigate();

  return (
    <div>
      <h1>Welcome to our Draw And Guess game!
      </h1>
      <button onClick={() => navigator("/word-choose")}>Click to start</button>
    </div>
  );
};

export default Welcome;
